(3, 'Echec', 'Activité intellectuelle', 'L\'activité \"échec\" dans notre application capture les moments où les tentatives ne produisent pas les résultats escomptés. Elle fournit une vision claire des domaines nécessitant des ajustements et des améliorations. En enregistrant ces échecs, nous favorisons une culture d\'apprentissage et d\'amélioration continue au sein de notre plateforme.', '65edb3dcadfa7.png'),
(4, 'bibliothèque', '\"Découvrez notre bibliothèque de livres,', 'personnel. Que vous soyez passionné de fiction, avide de connaissances non fictionnelles ou à la recherche de moments de détente, notre bibliothèque propose une collection diversifiée pour satisfaire tous les goûts. Rejoignez-nous et explorez les trésors littéraires qui vous attendent, créant ainsi une expérience de lecture immersive et inoubliable.\"', '65ee1ae0075d7.jpg'),
